import React, { useState } from "react";
import Card from './Card'

const StudentCard = (props) => {

    return (
        <div>
        {
            props.studentk.map(student =>
                <Card
                    id={student.studentK.studentNum}
                />
            )
        }
        </div>
    )

}

export default StudentCard;
